import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SurrenalineService {

  private apiUrl = 'https://localhost:7129/api/ComplicationHypothyroidies';

  constructor(private http: HttpClient) { }
  addthyroide(ComplicationHypothyroidie: ComplicationHypothyroidie): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationHypothyroidie);

    return this.http.post<any>(`${this.apiUrl}/addthyroide`, ComplicationHypothyroidie, { observe: 'response' });
  }}
